import React from 'react'
import './Button.scss'

class Button extends React.Component {
    render() {
        let nums = ['double', 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine'];

        return (
            nums.map((num) => {
                return (
                    <button className={`button ${[num]} nums`}>
                        {num}
                    </button> 
                )
            }) 
        )
    } 
}

export default Button;
